#include <iostream>
#include <string>
#include <vector>
#include <algorithm>

using namespace std;
class Solution {
public:
	bool isIn(vector<string>& words, string s) {
		for (size_t i = 0; i < words.size(); i++)//for var is too slow.
			if (words[i] == s)
				return true;
		return false;
	}
	string longestWord(vector<string>& words) {
		unsigned int max = 0;	//more fast.
		sort(words.begin(), words.end());
		vector<int> weight(words.size(), 0);
		for (int i = words.size() - 1; i >= 0; i--)
			for (size_t j = 0; j < words[i].size(); j++) {
				if (isIn(words, words[i].substr(0, j + 1)))
					weight[i]++;
				else {
					weight[i] = 0;
					break;
				}
			}
		for (size_t i = 0; i < words.size(); i++)
			if (max < weight[i])
				max = weight[i];
		for (size_t i = 0; i < words.size(); i++)
			if (weight[i] == max)
				return words[i];

		return "";
	}
};

